import React from 'react';
import { Container } from 'react-bootstrap';
import '../home.css';


const Home:React.FC = () => {
    return (
     <Container className='mt-5'>
        <h1 className='header'>  Hi, I'm <br /> Ionut Ciornei <br /> aspiring front-end developer!</h1>
        <p className='ms-5'>frontend developer</p>
        <img src="/img/me.jpg" alt="me" style={{position: 'absolute',
  left: '40%', top: '100px'}}  className='imgStyle'/>
     </Container>      
    )
};

export default Home;
